            while (QRUtil.getBCHDigit(d) - QRUtil.getBCHDigit(QRUtil.G18) >=
              0) {
              d ^= (QRUtil.G18 << (QRUtil.getBCHDigit(d) - QRUtil.getBCHDigit(
                QRUtil.G18)));
            }
            return (data << 12) | d;
